an participado mÃ¡s de unaÂ  veintena de representantes del sector oleÃ­cola jiennense, haÂ  agradecido especialmente a la consejera \"su asistencia a esta reuniÃ³nÂ  que se celebra cuando ya ha empezado una campaÃ±a importante por loÂ  que supone para el empleo y para que muchas familias puedan tenerÂ  ingresos que les permitan vivir durante el resto del aÃ±o\". <br /><br />Este foro tambiÃ©n tiene lugar coincidiendo con \"los ÃºltimosÂ  coletazos de un elemento que es fundamental para la provincia, laÂ  reforma de la PAC\". En este sentido, segÃºn ha informado laÂ  DiputaciÃ³n, Reyes ha subrayado que \"aunque los agricultores sonÂ  conscientes de que lo mÃ¡s importante no son las ayudas comunitarias,Â  sino que el aceite tenga un precio justo que les permita mantener laÂ  actividad en el territorio, mientras esas ayudas existan hay queÂ  hacer una defensa a ultranza de las mismas, porque si EspaÃ±a noÂ  pierde en ese reparto de la PAC, en ese sobre nacional, no puedenÂ  perder AndalucÃ­a, JaÃ©n ni el olivar\". <br /><br />Por su parte, la consejera de Agricultura, Pesca y DesarrolloÂ  Rural ha resaltado \"el interÃ©s de este consejo en el que ya se haÂ  reflexionado previamente sobre la PAC, que estÃ¡ en su proceso final,Â  con el debate sobre su modelo de aplicaciÃ³n en EspaÃ±a, y losÂ  mecanismos de gestiÃ³n de mercados en esta nueva normativa. <br /><br />Entre otras cuestiones, la consejera ha lamentado que en estasÂ  negociaciones \"no se haya tocado la regulaciÃ³n de los mercados\", aÂ  pesar de que de ellos dependen \"el 70 por ciento de los ingresos delÂ  sector agrÃ­cola\". AdemÃ¡s, ha hecho hincapiÃ© en que aÃºn quedan porÂ  cerrar cuestiones de gran relevancia para AndalucÃ­a, ya que Ã©stasÂ  podrÃ­an suponer una reducciÃ³n del volumen de ayudas que recibeÂ  actualmente la comunidad. <br /><br />VÃ­boras, segÃºn ha indicado la Junta, se ha referido concretamenteÂ  a la posibilidad de que decrezca el montante total de ayudas directasÂ  que percibe la regiÃ³n (suma de ayudas acopladas y desacopladas) siÂ  las subvenciones acopladas ganan importancia, ya que esto harÃ­a queÂ  las ayudas desacopladas perdieran peso en el volumen global. ParaÂ  evitarlo, el Gobierno andaluz apuesta por adaptar el futuro repartoÂ  de las ayudas acopladas para compensar el trasvase y que AndalucÃ­aÂ  continÃºe recibiendo asÃ­ el mismo total de ayudas directas. <br /><br />Por otro lado, ha recalcado que los simulacros de reparto de losÂ  fondos del segundo pilar de la PAC, relativo al desarrollo rural,Â  podrÃ­an hacer perder a la regiÃ³n una parte importante de estas ayudasÂ  en el marco 2014-2020. \"Estamos preocupados, porque nos jugamosÂ  mucho\", ha apostillado. <br /><br /></p></div>\r<!-- END: WRAPBUTTONS CONTENT --></div><span class=\"article_separator\">&nbsp;</span><script type=\"text/javascript\">\r<!--\rvar jcomments=new JComments(68493, 'com_content','/index.php?option=com_jcomments&amp;tmpl=component');\rjcomments.setList('comments-list');\r//-->\r</script>\r<div id=\"jc\">\r<div id=\"comments\"></div>\r<a id=\"addcomments\" href=\"#addcomments\"></a><p class=\"message\">RegÃ­strese para comentar</p><div id=\"comments-footer\" align=\"center\"><a href=\"http://www.joomlatune.com\" title=\"JComments\" target=\"_blank\">JComments</a></div>\r<script type=\"text/javascript\">\r<!--\rjcomments.setAntiCache(0,1,0);\r//-->\r</script> \r</div><div style=\"display:none\"><a href='http://emaths.co.uk/notebook/news.php?good-natural-supplements-for-weight-loss'>good natural supplements for weight loss</a><a href='http://emaths.co.uk/notebook/news.php?jackson-siegelbaum-low-cholesterol-diet'>jackson siegelbaum low cholesterol diet</a><a href='http://emaths.co.uk/notebook/news.php?obesity-and-breast-cancer-risk'>obesity and breast cancer risk</a><a href='http://emaths.co.uk/notebook/news.php?dukan-diet-meal-plans'>dukan diet meal plans</a><a href='http://emaths.co.uk/notebook/news.php?hcg-injections-for-weight-loss-cape-town'>hcg injecti